import { Injectable } from '@angular/core';
import { Car } from './Classes';

@Injectable({
  providedIn: 'root',
})
export class CarService {
  private cars: Car[] = [];

  constructor() {
    // Initialize cars or fetch them from an API, database, etc.
    this.cars.push(new Car('Porsche', '911 Carrera', 2022));
    this.cars.push(new Car('Ferrari', 'SF90 Stradale', 2023));
  }

  getCars(): Car[] {
    return this.cars;
  }
}
